class SignUp extends Component{
constructor(){
    super()
    this.state={
        onlineUser : 0
    }
}

goOnline =()=>{
    this.state({
        onlineUser : this.state.onlineUser+1
    })
}

render(){
    return(
        <div>
            hey user {this.state.onlineUser}
            <button onClick={this.goOnline}> Go Online</button>
        </div>
    )
}


}

